import React from 'react';
import './App.css';
import HomePage from './HomePage/HomePage'
import IndexPage from './IndexPage/IndexPage'
import styles from './Static/Scss/styles.scss'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/">
          <HomePage />
          </Route>
          <Route path="/index">
          <IndexPage />
          </Route>
        </Switch>

      </Router>
    </div>
  );
}

export default App;
